                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if (copyMask?.Script ?? true)
            {
                errorMask?.PushIndex((int)Ingredient_FieldIndex.Script);
                try
                {
                    item.Script_Property.SetLink(
