                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if (copyMask?.Value ?? true)
            {
                errorMask?.PushIndex((int)Ingredient_FieldIndex.Value);
                item.Value = rhs.Value;
                errorMask?.PopIndex();
            }
            if (copyMask?.Flags ?? true)
            {
